webpackJsonp([0x9a0ddeb694ee],{298:function(t,n){t.exports={data:{site:{siteMetadata:{title:":-)",author:"github.com/9renpoto"}},markdownRemark:{id:"/home/travis/build/9renpoto/entry/src/pages/2017-06-08-nuxt-static-site-genetator/index.md absPath of file >>> MarkdownRemark",html:'<h1>TL;DR</h1>\n<ul>\n<li>SSRかと思ったら静的サイトも生成できる時代</li>\n<li>良い素振り環境であれば進んで移行</li>\n</ul>\n<h2>gatsby</h2>\n<p><a href="https://www.staticgen.com/gatsby">https://www.staticgen.com/gatsby</a></p>\n<ul>\n<li>Reactベースで、ブログやドキュメントのような静的サイトを生成出来るツールとして様子を見ていた</li>\n<li>\n<p>webpack v1系の依存が取れなていない</p>\n<ul>\n<li>webpack v3-rcが来てしまったことを考えると厳しそう</li>\n<li>@storybook/reactの苦い経験</li>\n</ul>\n</li>\n<li>Routerの素振り環境として魅力的だったものの尻込みしていた</li>\n</ul>\n<h2>nuxt.js</h2>\n<p><a href="https://www.staticgen.com/nuxt">https://www.staticgen.com/nuxt</a></p>\n<ul>\n<li>inspired by next.jsなライブラリ</li>\n<li>\n<p>存在は知っていたがまさか静的サイト生成が可能らしい</p>\n<ul>\n<li>staticgen.com参照して気づく</li>\n</ul>\n</li>\n<li>触ってみる価値はあると判断</li>\n<li>RSSなどブログっぽいものはない可能性</li>\n</ul>\n<h2>next.js</h2>\n<ul>\n<li>\n<p>next.jsも同様に可能？</p>\n<ul>\n<li><a href="https://github.com/zeit/next.js/issues/604">https://github.com/zeit/next.js/issues/604</a></li>\n</ul>\n</li>\n<li>普段はReactを触っていることが多いため可能ならこちらから</li>\n</ul>',frontmatter:{title:"nuxt static site genetator",date:"June 08, 2017"}}},pathContext:{path:"/entry/2017/06/08/nuxt-static-site-genetator/",_PARENT:"SOURCE"}}}});
